BEGIN SET NOCOUNT ON;
DECLARE @customer_id UNIQUEIDENTIFIER DECLARE @country VARCHAR(2)
SELECT @customer_id = INSERTED.customer_id, @country = INSERTED.country FROM INSERTED IF(SELECT country from customers where customer_id = @customer_id) != @country AND @country is not null BEGIN UPDATE [dbo].[customers] SET [country]= @country WHERE customer_id = @customer_id END END

